    <script>
window.NETWORK = "unity";
window.AD_NET = 'unt';
window.SOUND_ON = true;
window.ANALYTICS_ON = true;
window.IS_STANDALONE = true;

const startGame = () => {
    if(startGame.started) return;
    startGame.started = true;


    if(window.Game && !window.cc) {
        Game.init();

        try {
            initListeners();
        }
        catch (e) {}
        finally {
            LayoutManager.fitLayout();
        }
    } else if(!window.Game && window.cc) {
        window.boot && window.boot();
    }
};

const domReadyHandler = () => {
    window.removeEventListener("load", domReadyHandler);
    startGame();
};

const mraidReadyHandler = () => {
    mraid.removeEventListener("ready", mraidReadyHandler);
    console.log("MRAID ready", window.location.href);
    if (mraid.isViewable()) {
        console.log("MRAID not viewable");
        return mraidViewableHandler(true);
    }
    mraid.addEventListener("viewableChange", mraidViewableHandler);
};

const mraidViewableHandler = (flag) => {
    if (!startGame.started && flag) {
        console.log("MRAID viewable", window.location.href);
        mraid.removeEventListener("viewableChange", mraidViewableHandler);
        startGame();
    }

    if(window.cc) {
        if (flag) {
            window.cc.director.resume();
            if (window.cc.audioEngine !== undefined) {
                window.cc.audioEngine.resumeMusic();
                window.cc.audioEngine.resumeAllEffects();
            }
        } else {
            window.cc.director.pause();
            if (window.cc.audioEngine !== undefined) {
                window.cc.audioEngine.pauseMusic();
                window.cc.audioEngine.pauseAllEffects()
            }
        }
    }
};

const initListeners = () => {
    window.addEventListener("resize", LayoutManager.fitLayout);
    setInterval(LayoutManager.fitLayout, 100);
    
    mraid.addEventListener("stateChange", (state) => {
        if (state === "expanded") {
            startGame();
            LayoutManager.fitLayout();
        }
    });
    mraid.addEventListener("sizeChange", () => {
        console.log("MRAID sizeChange", arguments);
        LayoutManager.fitLayout();
    });
    mraid.addEventListener("viewableChange", () => {
        console.log("MRAID viewableChange", arguments);
        LayoutManager.fitLayout();
    });
    mraid.addEventListener("error", () => {
        console.log("MRAID error", arguments);
    });
};

const callSDK = (e) => {
    if(e === "download") {
        let userAgent = navigator.userAgent || navigator.vendor;
        let url = CONFIG.appStoreUrl;
        if (/android/i.test(userAgent)) {
            url = CONFIG.playStoreUrl;
        }

        if (typeof mraid !== "undefined") {
            mraid.open(url)
        } else {
            window.open(url)
        }
    }

    Game.emit('callSDK', e);
};

const redirect = ()=> {
    if (window.REDIRECT_URL) {
        if (typeof mraid !== "undefined") {
            mraid.open(window.REDIRECT_URL)
        } else {
            window.open(window.REDIRECT_URL)
        }
    }
    console.log('redirect')
}

try {
    if (mraid.getState() === "loading") {
        mraid.addEventListener("ready", mraidReadyHandler);
    }
    else {
        mraidReadyHandler();
    }
}
catch (e) {
    if (e.name === "ReferenceError") {
        // mraid is not defined
        window.addEventListener("load", domReadyHandler);
    }
}
</script>
